import React from 'react';
import './employee_info.css'

function employee_info(){
    return(
        <div classname='container'>
            <div className='row justify-content-center'>
                <div className='col-8-lg col-11 align-items-center bg-secondary justify-content-center'>
                    <div className="col-3">
                    eiei
                    </div>
                    <div className="col-3">
haha
                    </div>
                    <div className="col-3">
lala
                    </div>
                </div>
            </div>
        </div>
    );
}
export default employee_info;
